    false,nt"url": null,nt"notes": "This narrative report for Necedah NWR outlines
    Refuge accomplishments from May through August of 1950. The report begins by summarizing
    the weather conditions and water conditions during this period. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    mammals, and raptors- is also covered. The Refuge development and maintenance section
    discusses physical developments and plantings. Resource management is outlined;
    topics include grazing, haying, and timber removal. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    fishing, and violations. N-R forms and photographs are attached.",nt"owner_org":
